func txExample() *types.Transaction {
	var tx types.Transaction
	reader := bytes.NewBuffer(common.Hex2Bytes(txExampleRLP))
	stream := rlp.NewStream(reader, 0)
	err := tx.DecodeRLP(stream)
	if err != nil {
		panic(err)
	}
	return &tx
}

const (
	txExampleRLP = ""
)
